"use strict";(self.webpackChunkinboxsdk_docs=self.webpackChunkinboxsdk_docs||[]).push([[53],{1109:e=>{e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"someSidebar":[{"type":"link","label":"Getting Started","href":"/inboxsdk-docs/","docId":"getting-started"},{"type":"category","label":"API Reference","items":[{"type":"link","label":"InboxSDK.*","href":"/inboxsdk-docs/inboxsdk-star","docId":"inboxsdk-star"},{"type":"link","label":"Compose","href":"/inboxsdk-docs/compose","docId":"compose"},{"type":"link","label":"Lists","href":"/inboxsdk-docs/lists","docId":"lists"},{"type":"link","label":"Conversations","href":"/inboxsdk-docs/conversations","docId":"conversations"},{"type":"link","label":"Toolbars","href":"/inboxsdk-docs/toolbars","docId":"toolbars"},{"type":"link","label":"Router","href":"/inboxsdk-docs/router","docId":"router"},{"type":"link","label":"NavMenu","href":"/inboxsdk-docs/navmenu","docId":"navmenu"},{"type":"link","label":"Widgets","href":"/inboxsdk-docs/widgets","docId":"widgets"},{"type":"link","label":"ButterBar","href":"/inboxsdk-docs/butterbar","docId":"butterbar"},{"type":"link","label":"Search","href":"/inboxsdk-docs/search-docs","docId":"search-docs"},{"type":"link","label":"User","href":"/inboxsdk-docs/user","docId":"user"},{"type":"link","label":"Global","href":"/inboxsdk-docs/global","docId":"global"},{"type":"link","label":"Keyboard Shortcuts","href":"/inboxsdk-docs/keyboard-shortcuts","docId":"keyboard-shortcuts"},{"type":"link","label":"Common Data Types","href":"/inboxsdk-docs/common-data-types","docId":"common-data-types"}],"collapsed":false,"collapsible":false},{"type":"link","label":"Resources","href":"/inboxsdk-docs/resources","docId":"resources"},{"type":"link","label":"Change Log","href":"/inboxsdk-docs/changelog","docId":"changelog"}]},"docs":{"butterbar":{"id":"butterbar","title":"ButterBar","description":"This namespace contains methods for showing informative messages to the user. In Gmail this is a small yellow \\"butter bar\\" overlay near the top.","sidebar":"someSidebar"},"changelog":{"id":"changelog","title":"Change Log","description":"The InboxSDK loads its code remotely from our servers, so users get the latest code and bug fixes automatically without extension developers being required to make any changes. We also often introduce new features over time, and on occasion we deprecate old APIs and recommend new ones. These API changes will be listed here and announced in emails to registered developers as necessary.","sidebar":"someSidebar"},"common-data-types":{"id":"common-data-types","title":"Common Data Types","description":"---","sidebar":"someSidebar"},"compose":{"id":"compose","title":"Compose","description":"This namespace contains methods and types related to adding your application elements to the Gmail Compose UI. The compose UI has two variants. The New Compose UI appears when users are composing new messages and appear as windows above the rest of the app content. The second, the Reply UI, appears when users are replying to existing messages from the message they are replying to. This namespace handles both of these variants equivalently.","sidebar":"someSidebar"},"conversations":{"id":"conversations","title":"Conversations","description":"This namespace allows you to interact with Gmail conversations (typically called threads). The fundamental views you interact with are ThreadView and MessageView and there is a 1 to many relationship between them. The functions in Conversations.* allow you to obtain these views which you can then further manipulate.","sidebar":"someSidebar"},"getting-started":{"id":"getting-started","title":"Getting Started","description":"What is the InboxSDK?","sidebar":"someSidebar"},"global":{"id":"global","title":"Global","description":"This namespace contains methods and types related to the UI Elements that are available Globally in Gmail.","sidebar":"someSidebar"},"inboxsdk-star":{"id":"inboxsdk-star","title":"InboxSDK.*","description":"The functions in this class are only used for load related functionality like loading the SDK itself or other external scripts.","sidebar":"someSidebar"},"keyboard-shortcuts":{"id":"keyboard-shortcuts","title":"Keyboard Shortcuts","description":"This namespace allows you to setup keyboard shortcuts that your application can response to.","sidebar":"someSidebar"},"lists":{"id":"lists","title":"Lists","description":"This namespace allows you to interact with Lists of emails. They typically appear in various views like Inbox, Search or Labels. The interaction primarily lets you view and modify data in each row of the list.","sidebar":"someSidebar"},"navmenu":{"id":"navmenu","title":"NavMenu","description":"This namespace contains functionality associated with adding navigation items to the navigation menu of Gmail. Typically, these navigation links are accessible by the user on the left side of the email client and include built in navigation items like the Inbox, Sent Mail or Drafts links.","sidebar":"someSidebar"},"resources":{"id":"resources","title":"Resources","description":"Example Apps","sidebar":"someSidebar"},"router":{"id":"router","title":"Router","description":"This namespace contains functionality associated with creating your own content inside Gmail. It allows you to define \\"Routes\\" which define a full page of content and an associated URL space for which they are active. You can think of routes as different pages in your application. Gmail already have a few routes built in (Inbox, Sent, Drafts, etc). This namespace allows you to define your own as well as listen in on the built in routes being navigated to.","sidebar":"someSidebar"},"search-docs":{"id":"search-docs","title":"Search","description":"This namespace allows you to interact with Gmail\'s default search behaviour. It allows for two use cases: 1) To provide autocomplete suggestions as the user types in their query and 2) To rewrite sarch queries.","sidebar":"someSidebar"},"toolbars":{"id":"toolbars","title":"Toolbars","description":"The Toolbar namespace allows you to add your own buttons and actions to various toolbars in Gmail or Inbox. Toolbars appear in various Lists, ThreadViews and MessageViews. Within a toolbar, you have control over the placement of your buttons.","sidebar":"someSidebar"},"user":{"id":"user","title":"User","description":"This namespace contains methods and types related to the currently logged in user.","sidebar":"someSidebar"},"widgets":{"id":"widgets","title":"Widgets","description":"This namespace contains functions for creating various widgets that are styled to look and feel native to Gmail.","sidebar":"someSidebar"}}}')}}]);